"     Lactation",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Enters breast milk/not recommended",
"    </p>",
"   </div>",
"   <div class=\"block brc drugH1Div\" id=\"F7788183\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Breast-Feeding Considerations",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Hydrochlorothiazide is excreted into breast milk; it is not known if bisoprolol is found in human milk.",
"    </p>",
"   </div>",
"   <div class=\"block dic drugH1Div\" id=\"F10067860\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
