var title_f25_28_26059="AAN parameter for concussion management";
var content_f25_28_26059=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F50626&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F50626&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    American Academy of Neurology practice parameter for concussion management",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Grade 1",
"       </td>",
"       <td class=\"subtitle1\">",
"        Grade 2",
"       </td>",
"       <td class=\"subtitle1\">",
"        Grade 3",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Presentation",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         1. Transient confusion",
"        </p>",
"        <p>",
"         2. No loss of consciousness",
"        </p>",
"        <p>",
"         3. Concussion symptoms for less than 15 minutes",
"        </p>",
"       </td>",
"       <td colspan=\"1\" rowspan=\"1\">",
"        <p>",
"         1. Transient confusion",
"        </p>",
"        <p>",
"         2. No loss of consciousness",
"        </p>",
"        <p>",
"         3. Concussion symptoms for more than 15 minutes",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         1. Loss of consciousness of any duration",
"        </p>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Management",
"       </td>",
"       <td>",
"        Athlete may return to play if asymptomatic at 15",
"minutes.",
"       </td>",
"       <td>",
"        Athlete can return to play if asymptomatic for one week.",
"       </td>",
"       <td>",
"        Transport to the hospital and observe overnight.",
"Athlete may",
"return to play when asymptomatic for one week (if loss of consciousness",
"was brief, ie, seconds) or for two weeks (if loss of consciousness was",
"prolonged).",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     American Academy of Neurology, Neurology 1997; 48:581.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
